import React from 'react'
import './Contact.css'

function Contact() {
    return (
        <div className='contact'>
            <a class="twitter-timeline" data-width="1200" data-height="850" data-theme="dark" href="https://twitter.com/amfoss_in?ref_src=twsrc%5Etfw">Tweets by amfoss_in</a> <script async src="https://platform.twitter.com/widgets.js" charset="utf-8"></script>
        </div>
    )
}

export default Contact
